import {Link} from 'react-router-dom'
import styled from "styled-components";

export const Logo = styled(Link)`
    border: 1px solid green;
    display: inline-flex;
    padding: 5px;
`;
export const Text = styled.p`
    font-size: 22px;
    color: #fff;
`;
